import {BrowserRouter, Switch, Route} from 'react-router-dom'
import MainPage from './components/main-page/main-page';
import './styles/App.scss';

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/">
        <div className="App">
          <MainPage />
        </div>
        </Route>
      </Switch>
    </BrowserRouter>
  );
}

export default App;
